import React from 'react';
import './RatePlaylist.css';
import StarRating from 'react-star-rating';
<link rel="stylesheet" href="node_modules/react-star-rating/dist/css/react-star-rating.min.css"></link>





const RatePlaylist = () => {

        return (
            <form target="_self" method="GET">

            <StarRating name="react-star-rating" caption="Rate this component!" totalStars={5} />

            <button type="submit" className="btn btn-primary">Submit Rating</button>

          </form>
        )

}

export default RatePlaylist;
